@Component({
  selector: 'app-root',
  templateUrl: './app.component.html'
})
export class AppComponent {
  title = 'app';
}
<router-outlet>
    <div class="loading">
        <div class="spinner"></div>
    </div>
  <app-carros></app-carros>
</router-outlet>
